def predict(triples: list[Triple]) -> str:
    """
    Generates a natural language sentence from a list of triples.
    """
    sentence = ""
    subject = ""
    for i, triple in enumerate(triples):
        if i == 0:
            subject = triple.subject
            sentence += f"{subject} "
        if triple.predicate == "city":
            sentence += f"is a city in {triple.object}. "
        elif triple.predicate == "country":
            sentence += f"which is in {triple.object}. "
        elif triple.predicate == "capital":
            sentence += f", where the capital is {triple.object}. "
        elif triple.predicate == "latinName":
            sentence += f"also known as {triple.object}. "
        elif triple.predicate == "nickname":
            sentence += f"often referred to as {triple.object}. "
        elif triple.predicate == "rector":
            sentence += f"is led by rector {triple.object}. "
        elif triple.predicate == "academicStaffSize":
            sentence += f"has an academic staff of {triple.object}. "
        elif triple.predicate == "established":
            sentence += f"was established in {triple.object}. "
        elif triple.predicate == "state":
            sentence += f"located in the state of {triple.object}. "
        elif triple.predicate == "hasToItsNortheast":
            sentence += f"with {triple.object} to its northeast. "
        elif triple.predicate == "hasToItsWest":
            sentence += f"and {triple.object} to its west. "
        elif triple.predicate == "isPartOf":
            sentence += f"which is part of {triple.object}. "
        else:
            sentence += f"and has a {triple.predicate} of {triple.object}. "

    return sentence.strip()

